// CategoryTitle.js
function CategoryTitle(props) {
    return (
        <a style={{
            display: 'block',
            marginBottom: '1em',
            border: '1px solid black', // black 색상의 1픽셀 테두리 추가
            padding: '10px', // 테두리와 글자 사이에 간격 추가
        }}>{props.title}</a>
    );
}

export default CategoryTitle;
